// src/components/CustomersPage.js
import React from 'react';

const CustomersPage = () => {
  return (
    <div>
      <h2>Сторінка користувачів</h2>
      <p>Ця сторінка наразі знаходиться в розробці.</p>
    </div>
  );
};

export default CustomersPage;
